    public void testGeneratedEncryptions() {
        String[] keyPair = Encryption.generateKeyPair();
        String toEncrypt = "Constant" + System.currentTimeMillis() + System.getProperty("user.home")+"söloagnmokljösafdnmgokijöasfdnjkolögbhnmasfoküjlighbnmkojialüsärdnmhbojkülsrngjkolSERNOJKGILÖNMSRIOKJLÜGNIOKSRLÖEJDGNMIOKJLÖsrengikoüläSENRIOÜGKLÄNASEROIÜKLÄEGNMKIOJLÖÄASRNGOIÖKLÄJSREDNMGIOKLÜÄSENRmiokläögnsreiKLOÖÄGNMOIKLÖÄersnmgolöäsERNMOÖGNMersolökägnolöiksÄERNGOLÄS";
        String encrypted = Encryption.encrypt(toEncrypt, keyPair[0]);
        System.out.println("Länge original: " + toEncrypt.length() + ", Länge verschlüsselt: " + encrypted.length());
        String decrypted = Encryption.decrypt(encrypted, keyPair[1]);
        assertEquals(toEncrypt, decrypted);
    }
    
